  <div id="tableContainer"></div>

  <script>
  document.addEventListener('DOMContentLoaded', () => {
    const raw = document.getElementById('csvData').textContent.trim();
    const lines = raw.split(/\r?\n/);
    const splitter = /,(?=(?:[^"]*"[^"]*")*[^"]*$)/;
    function parseLine(line) {
      return line.split(splitter).map(cell => {
        let v = cell.trim();
        if (v.startsWith('"') && v.endsWith('"')) v = v.slice(1, -1);
        return (!isNaN(v) && v !== '') ? parseFloat(v) : v;
      });
    }
    const headers = parseLine(lines.shift());
    let data = lines.filter(l => l.trim()).map(parseLine);

    // NEW: track display→data mapping
    const columnOrder = headers.map((_,i)=>i);

    const container = document.getElementById('tableContainer');
    const table = document.createElement('table');
    container.appendChild(table);
    const thead = table.createTHead();
    const tbody = table.createTBody();

    // Render header row (with drag-and-drop + sorting)
    function renderHeader() {
      thead.innerHTML = '';
      const row = thead.insertRow();
      columnOrder.forEach((dataIdx, displayIdx) => {
        const th = document.createElement('th');
        th.textContent = headers[dataIdx];
        th.setAttribute('data-index', displayIdx);
        th.draggable = true;

        // only allow sorting on cols after the first
        if (displayIdx > 0) th.classList.add('sortable');

        // DRAG start: remember source index
        th.addEventListener('dragstart', e => {
          e.dataTransfer.setData('text/plain', displayIdx);
        });
        // allow drop
        th.addEventListener('dragover', e => e.preventDefault());
        // DROP: reorder columns
        th.addEventListener('drop', e => {
          e.preventDefault();
          const from = parseInt(e.dataTransfer.getData('text/plain'), 10);
          const to = displayIdx;
          moveColumn(from, to);
        });
        // CLICK to sort
        th.addEventListener('click', () => {
          if (displayIdx > 0) sortBy(displayIdx);
        });

        row.appendChild(th);
      });
      updateHeaderArrows();
    }

    // Render body rows in current columnOrder
    function renderBody() {
      tbody.innerHTML = '';
      data.forEach(row => {
        const tr = tbody.insertRow();
        columnOrder.forEach((dataIdx, j) => {
          const td = tr.insertCell();
          const val = row[dataIdx];
          if (dataIdx === 0) {
            const vid = document.createElement('video');
            vid.src = val;
            vid.autoplay = true;
            vid.muted = true;
            vid.loop = true;
            vid.controls = true;
            td.appendChild(vid);
          } else {
            td.textContent = val;
          }
        });
      });
    }

    // Keep track of last sort state
    let last = { col: null, asc: true };

    function updateHeaderArrows() {
      Array.from(thead.rows[0].cells).forEach((th, i) => {
        th.classList.remove('asc','desc');
        if (i === last.col) th.classList.add(last.asc ? 'asc' : 'desc');
      });
    }

    // Move one column in columnOrder, adjust sort state, re-render
    function moveColumn(from, to) {
      const [col] = columnOrder.splice(from, 1);
      columnOrder.splice(to, 0, col);

      // adjust last.col so arrow stays on correct column
      if (last.col === from) {
        last.col = to;
      } else if (last.col > from && last.col <= to) {
        last.col--;
      } else if (last.col >= to && last.col < from) {
        last.col++;
      }
      renderHeader();
      renderBody();
    }

    // Sort by displayed column index
    function sortBy(displayCol) {
      const dataCol = columnOrder[displayCol];
      const numeric = data.every(r => typeof r[dataCol] === 'number');
      data.sort((a, b) => {
        return numeric
          ? a[dataCol] - b[dataCol]
          : String(a[dataCol]).localeCompare(String(b[dataCol]));
      });

      if (last.col === displayCol) {
        if (last.asc) data.reverse();
        last.asc = !last.asc;
      } else {
        last = { col: displayCol, asc: true };
      }

      updateHeaderArrows();
      renderBody();
    }

    // initial draw
    renderHeader();
    renderBody();
  });
  </script>

</body>
</html>
